import React, { useContext } from "react";
import { Link, NavLink } from "react-router-dom";
import UserContext from "../auth/UserContext";
import "./Navigation.css";
import { Stack } from '@mui/material';

import Logo from '../assets/images/Logo.png';

const Navigation = ({ logout }) => {
    const { currentUser } = useContext(UserContext);
    console.debug("Navigation", "currentUser=", currentUser);

    function loggedInNav() {
      return (
        <Stack direction="row" justifyContent="space-around" sx={{ gap: { sm: '123px', xs: '40px' }, mt: { sm: '32px', xs: '20px' }, justifyContent: 'none' }} px="20px">
          <Link to="/home">
            <img src={Logo} alt="logo" style={{ width: '48px', height: '48px', margin: '0px 20px' }} />
          </Link>
          <Stack
            direction="row"
            gap="40px"
            fontFamily="Alegreya"
            fontSize="24px"
            alignItems="flex-end"
          >
            <Link to="/home" style={{ textDecoration: 'none', color: '#3A1212', borderBottom: '3px solid #FF2625' }}>Home</Link>
            <Link to="/" style={{ textDecoration: 'none', color: '#3A1212', borderBottom: '3px solid #FF2625' }}>HOMEPAGE</Link>
            <a href="#exercises" style={{ textDecoration: 'none', color: '#3A1212' }}>Exercises</a>
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <NavLink className="nav-link" to="/profile">
                  Profile
                </NavLink>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/" onClick={logout}>
                  Log out {currentUser.first_name || currentUser.username}
                </Link>
              </li>
            </ul>
          </Stack>
        </Stack>
      );
    }

    function loggedOutNav() {
      return (
        <Stack direction="row" justifyContent="space-around" sx={{ gap: { sm: '123px', xs: '40px' }, mt: { sm: '32px', xs: '20px' }, justifyContent: 'none' }} px="20px">
          <Link to="/home">
            <img src={Logo} alt="logo" style={{ width: '48px', height: '48px', margin: '0px 20px' }} />
          </Link>
          <Stack
            direction="row"
            gap="40px"
            fontFamily="Alegreya"
            fontSize="24px"
            alignItems="flex-end"
          >
            <Link to="/home" style={{ textDecoration: 'none', color: '#3A1212', borderBottom: '3px solid #FF2625' }}>Home</Link>
            <Link to="/" style={{ textDecoration: 'none', color: '#3A1212', borderBottom: '3px solid #FF2625' }}>HOMEPAGE</Link>
            <a href="#exercises" style={{ textDecoration: 'none', color: '#3A1212' }}>Exercises</a>
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <NavLink className="nav-link" to="/login">
                  Login
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link" to="/signup">
                  Sign Up
                </NavLink>
              </li>
            </ul>
          </Stack>
        </Stack>
      );
    }

    return currentUser ? loggedInNav() : loggedOutNav();
  };

  export default Navigation;
